import { useId } from "react"




export default function Dropdown({options}) {

    const objId = useId();

    const renderdOptions = options.map((options)=> {


        return <div key={objId}>
            {options}
        </div>
    })


    return <div>
        <div>Select...</div>
        <div></div>
    </div>
}
